description:
Special thanks to Morthis for the patched APK! Game will now start without getting stuck on downloading.

NOTE: This game does NOT save your progress. If you exit, you must start over. This is normal. It will save your tokens and collectibles, however, you must play through all three stages in one go (each has several parts, much like Sonic the Hedgehog games). More stages are planned for future releases.

